import * as React from "react";

import { Button, Table } from "react-bootstrap";
import { useAppState } from "../../../service/AppStateContext.tsx";
import BaseService from "../../../service/base.service.tsx";
import { Tables } from "../models/table";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { GoBack } from "../../../defultComponent/funPublik";

export const OpenModalTable = () => {
    let modal = document.getElementById("TablesViewModal").style.display = "block";
}

const TablesView = (props) => {



    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [table, setTables] = useState({}, Tables);


    const path = window.location.pathname;
    const splited = path.split("/");
    const id = splited[splited.length - 1]

    const { state } = useAppState();

    useEffect(() => {
        console.group("ssss", state);
        BaseService.fetch(`/tables/${id}`).then(
            (response) => {
                setIsLoaded(true);
                setTables(response.data[0], Tables);
                console.log("response.data", response.data);
                console.log("table Daqta", table);
                console.groupEnd();
            },
            (error) => {
                setIsLoaded(true);
                setError(error);
            }
        );
    }, []);
    return (
        <>
            <GoBack />
            <Table className="table table-dark">
                <tbody>
                    <tr>
                        <td>id</td>
                        <td>{table.id}</td>
                    </tr>
                    <tr>
                        <td>עדכון אחרון</td>
                        <td>{table.lastUpdated}</td>
                    </tr>
                    <tr>
                        <td>סטטוס</td>
                        <td>{table.status ?
                            <Link
                                to={"/customers/sitting/" + table.GroupSeqNum}
                                className="px-1"
                                title="view">
                                <Button variant="secondary">
                                    {table.GroupSeqNum}
                                </Button>
                            </Link> : "פנוי"}
                        </td>
                    </tr>
                    <tr>
                        <td>קיבולת</td>
                        <td>{table.capacity}</td>
                    </tr>
                </tbody>
            </Table>
        </>
    );
};
export default TablesView;
